import React from 'react';
import { NavLink } from 'react-router-dom';
import './TabNav.css';

const TabNav = ({ activeTab, category, manufacturer, series, model, categoryName, manufacturerName, seriesName, modelName }) => {
  return (
    <div className="tab-nav">
      <NavLink
        to="/"
        className={`tab-item ${activeTab === 'category' ? 'active' : ''}`}
      >
        <div>Category</div>
        <div className="subtitle">{categoryName}</div>
      </NavLink>
      <NavLink
        to={`/${category}`}
        className={`tab-item ${activeTab === 'manufacturer' || activeTab === 'series' || activeTab === 'model' || activeTab === 'alternative' ? '' : 'disabled'}`}
        onClick={(e) => {
          if (activeTab === 'category') e.preventDefault();
        }}
      >
        <div>Manufacturer</div>
        <div className="subtitle">{manufacturerName}</div>
      </NavLink>
      <NavLink
        to={`/${category}/${manufacturer}`}
        className={`tab-item ${activeTab === 'series' || activeTab === 'model' || activeTab === 'alternative' ? '' : 'disabled'}`}
        onClick={(e) => {
          if (activeTab === 'category' || activeTab === 'manufacturer') e.preventDefault();
        }}
      >
        <div>Series</div>
        <div className="subtitle">{seriesName}</div>
      </NavLink>
      <NavLink
        to={`/${category}/${manufacturer}/${series}`}
        className={`tab-item ${activeTab === 'model' || activeTab === 'alternative' ? '' : 'disabled'}`}
        onClick={(e) => {
          if (activeTab === 'category' || activeTab === 'manufacturer' || activeTab === 'series') e.preventDefault();
        }}
      >
        <div>Model</div>
        <div className="subtitle">{modelName}</div>
      </NavLink>
      <div className={`tab-item ${activeTab === 'alternative' ? 'active' : 'disabled'}`}>
        <div>Alternative</div>
      </div>
    </div>
  );
};

export default TabNav;
